INSERT INTO `candidates` VALUES (1,1725,'President','Legal Party','Great leaders don\'t set out to be a leader, they set out to make a difference. It\'s never about the ROLE always about the GOAL.','A 21-year-old, Rayhan Bint N. Moran Razul is a woman who stands for dignity and responsibility in any field. She is known as an active person that does everything to make things work efficiently and productively. She\'s an alumnus of MDC and is one of the students who are skilled in playing and training students with the sport Arnis. She also had leadership experiences that molded her while studying here at MDC.\r\n\r\n\r\nLeadership Experiences:\r\n\r\nGrades 1-5: Classroom Officer     \r\n                 2006-2011\r\nGrade 6: Supreme Student Government    P.I.O\r\n           :GSP Leader\r\n            2011-2012\r\nGrades 7-8: Classroom Officer (Sergeant at Arms)\r\n                :GSP Leader\r\n               2012-2015\r\nGrade 9: Classroom Officer as P.I.O\r\n           : GSP Leader \r\n             2015-2016\r\nGrade 10: SSG Grade 10 Representative\r\n             :Classroom Officer\r\n             :Catalyst Sports Writer\r\n             :GSP Leader\r\n              2016-2017\r\nGrade 11 : Class Vice-President\r\n            : Choir President\r\n            : Historical Society Officer\r\n             2017-2018\r\nGrade 12: CAT Officer ( Cadet Captain)\r\n            : INCA President (Intramurals)\r\n             2018-2019\r\n\r\nCollege\r\n\r\n1st Year: ROTC Cadet 3cl, ARMY (Res)\r\n            2nd Platoon Sergeant\r\n           :ROTC Vice-president (Batch BAGSIK)\r\n           :Class Mayor\r\n           :CCJ Auditor\r\n           2019-2020\r\n2nd and 3rd Year:\r\n           : Class Mayor\r\n           :CCJ Auditor\r\n            2020- Present\r\n\r\nOthers: Dean\'s Lister \r\n           2019-2029\r\n          : MDC Arnis Trainer\r\n          : Arnis Athlete ( BOHOL PROVINCE)\r\n           2017- Present','2021-09-13 10:08:09','2021-09-18 17:55:38'),(2,1481,'President','Moral Party','Your voices are my priorities. Together, let\'s work hand in hand as we face the challenges in this new normal.','Hello, MDCians! \r\nI am BLASCO, AERIAL DOVE, 20 years of age, from Mandaug Calape. I am a middle child of my parents and both my older siblings (Kuya Kenneth and Ate Randall) were SSG Presidents here in Mater Dei College. I am a self-motivated, skilled, and dedicated third year college student with high regards to public service and social functions. Absolutely capable at building positive relationships and communicating well with people of varied backgrounds. Here are some of my notable leadership backgrounds and achievements: Senate President of Supreme Student Government at Mater Dei College (A.Y 2019-2021); Staff Writer of The Exemplar at Mater Dei College (A.Y 2019 ‚Äì 2021); Feature Editor of The Exemplar at Mater Dei College (2021-Present); President of Student Catholic Action at Mater Dei College-College Department (A.Y 2019 ‚Äì 2020); Class President of Civic Welfare Training Service at Mater Dei College (A.Y 2019 - 2020); Auditor of Science Club at Mater Dei College (A.Y 2019 ‚Äì 2020); President of Supreme Student Government at Tubigon West National High School (A.Y 2018-2019); Rover Scout at Tubigon West National High School (A.Y 2018 ‚Äì 2019); President of Student Catholic Action at Tubigon West National High School (A.Y 2016 ‚Äì 2017); President of Student Catholic Action at Tubigon West National High School (A.Y 2015 ‚Äì 2016); Overall Troops Commander of Girl Scout of the Philippines at Tubigon West National High School (A.Y 2016 ‚Äì 2017); Literary Editor of The Radiance at Tubigon West National High School (A.Y 2014 ‚Äì 2015); Grade 8 and Grade 9 Supreme Student Government Representative at Tubigon West National High School (A.Y. 2014-2016); Edgar M. Chatto Leadership Awardee; Student Council during my elementary years; Graduated as Valedictorian at Mandaug Elem. School (A.Y 2012 ‚Äì 2013); Graduated as With Higher Honor at Tubigon West National High School (A.Y 2015 - 2016); Graduated as 4th in overall rank at Tubigon West National High School (A.Y 2017 ‚Äì 2019); I am also a Dean‚Äôs Lister. Moreover, I attended some leadership seminars, trainings, and workshops such as Kool Adventure Camp-SSG Leadership Course @Balamban, Cebu, City (September 19-21, 2018); 1st Seminar ‚Äì Workshop on Student Leadership at Tubigon West National High School (June 10-12, 2017); Capability Building for Student Leaders and Teacher Advisers at Bohol Province Employees Multi- Purpose Cooperative, Tagbilaran City (March 07, 2018); Classroom Management Intervention Program in Basic Bookkeeping and Accounting at Tubigon West National High School (October 2017 ‚Äì 2018); Internal Dance Workshop at Mater Dei College (June 2016); Campus Integrity Crusaders Orientation (July 27, 2016); National Earth Keepers Summit (November 10‚Äì13, 2016); and the Division Wide Supreme Student Elections and Seminar held at Baclayon (July 2018).\r\n\r\n\"ùïØùñäùñòùñôùñéùñìùñäùñâ ùñôùñî ùñòùñäùñóùñõùñä, ùñëùñäùñÜùñâ, ùñÜùñìùñâ ùñéùñìùñòùñïùñéùñóùñä.\"','2021-09-13 10:08:09','2021-09-23 15:49:11'),(3,1737,'Vice-President','Moral Party','I am to lead, hear and take action.',NULL,'2021-09-13 10:08:09','2021-09-17 09:18:07'),(4,1513,'Vice-President','Legal Party','Leader are drivers who lead to a good path,facilitates good relationships and communications to people',NULL,'2021-09-13 10:08:09','2021-09-23 15:35:06'),(5,1438,'Senator','Moral Party','In the service of the students','I love to sing, cook and travel. I am willing to be a voice and wholeheartedly dedicate myself to be at the service of the students. \r\n\r\nLeadership Experience :\r\nGrade 3 - Classroom Secretary (2009-2010)\r\nGrade 4 - Classroom Officer  (2010-2011)\r\nGrade 5 - Classroom Vice President (2011-2012)\r\nGrade 6 - Classroom Auditor (2012-2013)\r\nGrade 7 - Science Club Treasurer (2013-2014)\r\nGrade 8 - Classroom Vice President (2014-2015)\r\nGrade 9 - Classroom President (2015-2016\r\nGrade 9 - SSG PIO (2015-2016)\r\nGrade 9 - School\'s BSP Secretary (2015-2016)\r\nGrade 10 - Classroom Auditor (2016-2017)\r\nGrade 10 - SSG President (2016-2017)\r\nGrade 10 - School\'s BSP Auditor (2016-2017)\r\nGrade 11 - Classroom President (2017-2018)\r\nGrade 12 - Classroom President (2018-2019)\r\nSitio Bug-os Youth President -2017-2019\r\n\r\nSeminars and Trainings Participated :\r\nU4U Facilitators Training - July 16, 2016\r\nProvincial Summer Youth Camp - April 29-30, 2016\r\nNational Earthkeepers Summit - November 10-13,2016\r\nCrew Leaders Training Course - August 14-16, 2015\r\nCampus Integrity Crusaders (CIC) Orientation - July 27,2016\r\nBohol Youth Summit - \" Kami : Strengthening the campaign on Teenage Pregnancy and HIV/AIDS Prevention\" - December 16-18,2017\r\n\r\n\"Destined to serve, lead, and inspire.\"','2021-09-13 10:08:09','2021-09-22 20:10:22'),(6,336,'Senator','Moral Party','MDCians, let the competent and experienced leaders work for you.','Despite juggling the academic and organizational activities, my guilty pleasures include: reading books, travelling, playing chess and badminton. Through years of experience, I am ready to be your senator. Listed below are my notable leadership backgrounds and training throughout high school and at present. \r\n\r\nLeadership background:\r\n-	Class Mayor (Academic Year 2014 ‚Äì 2015)\r\n-	Grade 9 SSG Representative (Academic Year 2016 ‚Äì 2017)\r\n-	Trainee Unit Coordinator (Academic Year 2016 ‚Äì 2017)\r\n-	The Quest Editor-in-Chief (Academic Year 2017 ‚Äì 2018)\r\n-	Class Vice Mayor (Academic Year 2018 ‚Äì 2019)\r\n-	Mater Dei College SHS SCA President (Academic Year 2019 ‚Äì 2020)\r\n-	CM ‚Äì SCA Chapter Six President (Academic Year 2019 ‚Äì 2020)\r\n-	13th National Leadership Conference Team Leader (July 28 ‚Äì August 1, 2021)\r\n-	13th National Leadership Conference Drafting Committee (July 28 ‚Äì August 1, 2021)\r\n-	Class Beadle (Present)\r\n-	Sunflower Event for Dinky Soliman Volunteer (Present)\r\n-	International Young Catholic Students (IYCS) ‚Äì Asian Session and Council (Diocese of Tagbilaran Student Leader Representative) (Present)\r\n\r\nSeminars:\r\n-	Preparatory Cell Meeting ‚Äì Leadership Training on Weekends (2016)\r\n-	Media Festival (August 29 ‚Äì September 2, 2017)\r\n-	Monthly presidential meeting/seminar (2019 ‚Äì 2020)\r\n-	Diocesan Youth Congress (October 18 ‚Äì 20, 2020)\r\n-	End Child Prostitution Child Pornography and the Trafficking of Children for Sexual Purposes (2020)\r\n-	13th National Leadership Conference (July 28 ‚Äì August 1, 2021)\r\n-	Hirang Handa, Pili! (September 4, 2021)\r\n\r\n‚ÄúDestined to serve, lead, and inspire‚Äù','2021-09-13 10:08:09','2021-09-23 08:09:28'),(7,364,'Senator','Moral Party','Let me serve you.','Greetings in His name!\r\nA promising day to you MDCians! I am MEGAN P. MI√ëOZA from Pangangan, Calape, Bohol and I am 19 years old. My hobbies are singing, travelling, going out with friends, watching anime and K-drama. Below are the highlights of my achievements and leadership backgrounds.\r\n\r\nACHIEVEMENTS:\r\n\r\n‚Ä¢ JHS honor student \r\n‚Ä¢ Second Place Math Sayaw\r\n‚Ä¢ BACS MEET 2018 Taekwondo Silver Medalist \r\n‚Ä¢ SHS with honor\r\n‚Ä¢ 2nd Place of Bayani Look a Like\r\n‚Ä¢ Athlete of the Year\r\n‚Ä¢ PHILIPPINE TAEKWONDO ASSOCIATION- Christmas League 2019 Silver and Gold Medalist\r\n‚Ä¢ Most Punctual\r\n‚Ä¢ Miss PNHS 2018\r\n‚Ä¢ Most Neat\r\n‚Ä¢ Ribbon of Courage Awardee\r\n‚Ä¢ PRISAA 2020 Taekwondo Gold Medalist\r\n‚Ä¢ Regional PRISAA Taekwondo Player\r\n‚Ä¢ Ribbon if Sportsmanship Awardee\r\n‚Ä¢ Leadership Awardee\r\n\r\nLEADERSHIP BACKGROUNDS:\r\n\r\n‚Ä¢ CDT 2nd Lieutenant of MDC HS Department- CAT UNIT S.Y. 2018-2019\r\n‚Ä¢ CDT Major/S4 of MDC HS Department- CAT UNIT S.Y. 2019-2020\r\n‚Ä¢ CDT Captain 3rd Class of MDC College Department- ROTC UNIT S.Y. 2020-2021\r\n‚Ä¢ CDT Major 2nd Class of MDC College Department- ROTC UNIT S.Y. 2021-Present \r\n‚Ä¢ SCAN since\r\n‚Ä¢ PYM Member Pangangan Chapter\r\n‚Ä¢ Classroom Officer since Grade 1-Grade 12\r\n‚Ä¢ SSG Officer GRADE 9 Representative\r\n‚Ä¢ SSG Officer P.I.O 2017-2018\r\n\r\nServing is my passion. \r\n\"ùïØùñäùñòùñôùñéùñìùñäùñâ ùñôùñî ùñòùñäùñóùñõùñä, ùñëùñäùñÜùñâ, ùñÜùñìùñâ ùñéùñìùñòùñïùñéùñóùñä.\"','2021-09-13 10:08:09','2021-09-23 20:19:06'),(8,1698,'Senator','Moral Party','For a STUDENT TRUSTEE BODY: Less Talking, More on Doing.','In this time of adversity, it is our responsibility to nurture our health and our hale and genuine relationship with one another. \r\n\r\nI am Sheena Marie B. Poquita, an 18-year old lass who aspires to save thousands of lives very soon. My jouissance are reading books, baking, travelling most especially to beaches, binge watching medical movies and kdramas, visiting churches around Bohol, and of course, writing. I have provided you below some of my significant and noteworthy leadership background and trainings that I have undergone through the past years and up to present. \r\n\r\nLeadership Background:\r\n\r\nüìå Elementary: \r\n\r\n- Classroom Treasurer (Academic Years 2008-2013) \r\n- Classroom Mayor (Academic Year 2013-2014) \r\n- Supreme Student Government Senator (Academic Years 2010- 2014) \r\n- Science Club President (Academic Year 2013-2014) \r\n- Girl Scout of the Philippines President (Academic Year 2013-2014) \r\n\r\nüìå High School: \r\n\r\n- Theater Arts Club Member (Academic Years 2014-2017) \r\n- Student Catholic Action (Academic Years 2014-2020) \r\n- Classroom Treasurer (Academic Years 2014-2018) \r\n- Supreme Student Government Senator (Academic Years 2015-2018)\r\n- Girl Scout of the Philippines President (Academic Year 2017-2018)\r\n- MDC Sentry Feature and News Writer (Academic Years 2015- 2020)\r\n- Science Club Vice President (Academic Year 2019-2020) \r\n- MDC Bedal Corp. Vice President (Academic Year 2019-2020)\r\n- First Aid Organization Member (Academic Year 2019-2020) \r\n- STEM Medical 1 Mayor (Academic Year 2019-2020) \r\n\r\nüìå Outside the School: \r\n\r\n- Youth Leader (2016-Present) \r\n- Parish Youth Ministry - Core Group (2017-Present) \r\n\r\nüìå Trainings/Conferences/Seminars: \r\n\r\n- Salinlahi Symposium Series of the Department of Science and Technology (2018)\r\n- Diocesan Youth Congress (2019)\r\nNew Evangelization Conference (2019)\r\n- Division Schools Press Conference (2019) \r\n- Basic First Aid Orientation Seminar (2019)\r\n\r\n\"ùïØùñäùñòùñôùñéùñìùñäùñâ ùñôùñî ùñòùñäùñóùñõùñä, ùñëùñäùñÜùñâ, ùñÜùñìùñâ ùñéùñìùñòùñïùñéùñóùñä.\"','2021-09-13 10:08:09','2021-09-23 07:39:14'),(9,805,'Senator','Moral Party','You sure can talk the talk, but you‚Äôre not quite ready to walk the walk. Time‚Äôs up, it‚Äôs my turn.',NULL,'2021-09-13 10:08:09','2021-09-17 08:18:16'),(10,452,'Senator','Moral Party','A change we need, a voice we deserve.',NULL,'2021-09-13 10:08:09','2021-09-17 07:35:09'),(11,1679,'Senator','Legal Party','Lead by example.','üìçChairperson of Bohol Philippine Institute of Accountants - Education & Research Committee 2021-2022\r\nüìç2nd year Representative of MDC JPIA S.Y. 2020-2021\r\nüìçSSC Treasurer at Salus Institute of Technology S.Y. 2016-2017\r\nüìçClassroom Officer  Grade 7 to Grade 12','2021-09-13 10:08:09','2021-09-19 07:32:59'),(12,1643,'Senator','Legal Party','',NULL,'2021-09-13 10:08:09','2021-09-13 10:08:09'),(13,1526,'Senator','Legal Party','Good Leaders must first become Good Servants.',NULL,'2021-09-13 10:08:09','2021-09-19 13:27:36'),(14,1465,'Senator','Legal Party','The greatest leader is not necessarily the one who does the greatest things. He is the one that gets the people to do the greatest things.','I am Toni Faith Kyla R. Sanggod, 20 years old. An MDCian since senior highschool.\r\nLeadership Background:\r\nGrade 8: Class Auditor\r\nGrade 9 : Class Treasurer              \r\nGrade 10: Class Secretary            \r\nGrade 11: Class