ions\r\nHeld on may 5th 2019 at OOC Training Camp/ Crossroads Mall,\r\n	Banilad Cebu CIty\r\n            CHAPMION 1ST Place\r\n\r\n	Strongest Man\r\n		Open mens\'s Division\r\n	Philippines Strongest Man and Woman\r\n	Visayas Qualifications\r\n	Held in ICM Dao Tagbilaran CIty Bohol\r\n		4th Place\r\n		2019','2021-09-13 10:08:09','2021-09-19 15:54:24'),(19,496,'Representative','Legal Party','Leaders should LISTEN and ACHIEVE the need of other before their own personal need.',NULL,'2021-09-13 10:08:09','2021-09-18 07:26:09'),(20,1308,'Representative','Legal Party','Ally is I stand up with you, and I am brave with you.',NULL,'2021-09-13 10:08:09','2021-09-17 19:37:39'),(21,1520,'Representative','Legal Party','Action speaks more than titles.','Bringing out the best in you is my goal.\r\nTo lead by example not only in academic pursuits but also in co-curricular as well.\r\nLeadership Background:\r\n\r\nClassroom Mayor and Vice-President - Sagbayan Central Elementary School (Supreme Student Government) 2012-2013\r\n\r\nSaint Augustine Institute of Sagbayan Bohol Incorporated.\r\n\r\n‚Ä¢Grade 7 - SSG Grade 7 Governor 2013-2014 \r\n\r\n‚Ä¢Grade 8 - SSG Grade 8 Governor 2014-2015\r\n\r\n‚Ä¢Grade 9 - SSG senator 2015-2016\r\n\r\n‚Ä¢Grade 10- SSG Vice-President 2016-2017\r\n\r\nSCA PIO \r\n\r\n‚Ä¢PYM Vice Coordinator Sagbayan Chapter 2016-2017\r\n\r\n‚Ä¢MDC Sr. High school\r\nGrade 11- Classroom PIO\r\n\r\n‚Ä¢Grade 12- SCA Vice-President Administration (MDC SHS) 2018-2019\r\n\r\nCollege MDC\r\n\r\n‚Ä¢1st year college - English Wizards 1st Year representative 2019-2020\r\n\r\n‚Ä¢3rd Year- Current Associate Editor Internal of The Exemplar\r\nOthers:\r\nConsistent top student from Elementary to Highschool and graduated as With High Honor and Top 8 in Humss Strand during Sr. High Years in MDC \r\nCollege of Education Dean\'s Lister','2021-09-13 10:08:09','2021-09-24 23:37:46'),(22,1440,'Representative','Moral Party','Voice and Ears of the Students','A person who loves to read inspirational books and who is wholeheartedly willing to help and serve others. \r\n\r\nLeadership Background: \r\n‚Ä¢ SSG Treasurer (2015-2016)\r\n‚Ä¢Youth for Environment in Schools Organization (YES-O) member in my junior high years\r\n‚Ä¢Youth President in church\r\n‚Ä¢Grade 6- Classroom Secretary (2012-2013)\r\n‚Ä¢Grade 7- Classroom Auditor- (2013-2014)\r\n‚Ä¢Grade 8- Classroom Secretary (2014-2015)\r\n‚Ä¢Grade 9- Classroom P.I.O (2015-2016)\r\n‚Ä¢Grade 10- Classroom Auditor (2016-2017)\r\n‚Ä¢Grade 12- Classroom Auditor (2018-2019)\r\n\r\n\"Destined to serve, lead, and inspire.\"','2021-09-13 10:08:09','2021-09-22 20:18:04'),(23,795,'Representative','Moral Party','Students need their own voice, so make the right choice.','Hi, I\'m Bianarose, call me Biana or just Bian. I do appreciate everything I see and hear, the skies, the ocean, and all. I sing a lot and I play guitar sometimes. I\'m so imaginative that I also write stories sometimes. I love helping others as long as I can and even though I\'m a quiet person, I tend to speak a lot when I feel the need to speak for others, standing for what I believe is right. There\'s just a part of me that wants to serve and at the same time, lead.\r\n\r\nI run for the position of CABM-B Congresswoman because few people believe in me and that few are still something to reckon with, their trust is greater than numbers. God put me to this and so I know I can get through this for His plans are bigger and brighter than mine. After serving the whole College, I am now ready to serve my Department aiming in serving my seniors and guiding my juniors. Not just in helping my department at all times but also in motivating the younger ones to be the next leaders. \r\n\r\n‚Ä¢ Girl Scout Leader (Elem years) \r\n‚Ä¢ Classroom Secretary (All Elementary years) \r\n‚Ä¢ HFNS Choir member (2013-2017) \r\n‚Ä¢ INTRAMURALS INCA Team Secretary (2018-2019) \r\n‚Ä¢ Tinangnan YOUTH Treasurer \r\n‚Ä¢ CHAPEL YOUTH CHAIRMAN (2018-present) \r\n‚Ä¢ MDC SENTRY